class MiscType:
	def __init__(self, code):
		self.config = _miscDict[code]
		self.iSockets = 0 #self.config["gemsockets"]

	def writeStream(self, stream):
		if self.iSockets > 0:
			stream.append(self.iSockets, 4)

	def createBase(self):
		v = self.iSockets > 0 and 1 or 0
		return ItemBase(bSocketed=v)


class ArmorType:
	def __init__(self, code, iSockets):
		self.config = _armorDict[code]
		self.iSockets = min(iSockets, self.config["gemsockets"])

	def writeStream(self, stream):
		stream.append(0xfff, 11) # max def rating
		stream.append(0, 8) # max durability
		if self.iSockets > 0:
			stream.append(self.iSockets, 4)

	def createBase(self):
		v = self.iSockets > 0 and 1 or 0
		return ItemBase(bEthereal=1, bSocketed=v)


class WeaponType:
	def __init__(self, code, iSockets):
		self.code = code
		self.config = _weaponDict[code]
		self.iSockets = min(iSockets, self.config["gemsockets"])

	def writeStream(self, stream):
		# if nodurability, zero durability still working, but waste one line
		# of item description for "indestructible"
		if self.config["nodurability"]:
			stream.append(0x03333, 17)
		else:
			stream.append(0, 8)
		if self.config["maxstack"] > 0:
			stream.append(0xfff, 9)
		if self.iSockets > 0:
			stream.append(self.iSockets, 4)

	def createBase(self):
		e = self.config["nodurability"] and 0 or 1
		v = self.iSockets > 0 and 1 or 0
		return ItemBase(bEthereal=e, bSocketed=v)


def createByCode(code, nSockets=99):
	if code in _miscDict:
		return MiscType(code)
	elif code in _weaponDict:
		return WeaponType(code, nSockets)
	elif code in _armorDict:
		return ArmorType(code, nSockets)
	else:
		raise TypeError("Invalid code: '{0}'".format(code))

def iTypeFromCode(code):
	if code in _miscDict:
		return "misc", _miscDict[code]
	elif code in _weaponDict:
		return "weapon", _weaponDict[code]
	elif code in _armorDict:
		return "armor", _armorDict[code]
	else:
		return "unknown type"

